input_fmt: "str"
in_stdin: "bla bla bla im cool man"
in_source: |-
    .data
    input_addr: .word 0x80
    output_addr: .word 0x84
    .text
    _start:
        lui r0, %hi(output_addr)
        addi r0, r0, %lo(output_addr)
        lw r0, 0(r0) ; r0 - указатель на вывод
        lui r1, %hi(input_addr)
        addi r1, r1, %lo(input_addr)
        lw r1, 0(r1) ; r1 - указатель на вывод
        lw r2, 0(r1)
        while:
            beq r2, zero, end
            sw r2, 0(r0)
            lw r2, 0(r1)
            j while
        end:
            sw r2, 0(r0)
            halt

out_code: !!binary |
    gAAAAAEAAAAhEAAEGRAAAAIAAAAiIAAAGiAAABsgAAC4OAAMEBMAABsgAACAAP/wEBMAAMgAAAA=

out_data: !!binary |
    gAAAAIQAAAA=

out_code_hex: |-
    0 - 80000000 - j 0
    1 - 01000000 - lui r0, 0
    2 - 21100004 - addi r0, r0, 4
    3 - 19100000 - lw r0, 0(r0)
    4 - 02000000 - lui r1, 0
    5 - 22200000 - addi r1, r1, 0
    6 - 1A200000 - lw r1, 0(r1)
    7 - 1B200000 - lw r2, 0(r1)
    8 - B838000C - beq r2, zero, 12
    9 - 10130000 - sw r2, 0(r0)
    10 - 1B200000 - lw r2, 0(r1)
    11 - 8000FFF0 - j -16
    12 - 10130000 - sw r2, 0(r0)
    13 - C8000000 - halt

out_stdout: "Success\n============================================================\n[98, 108, 97, 32, 98, 108, 97, 32, 98, 108, 97, 32, 105, 109, 32, 99, 111, 111, 108, 32, 109, 97, 110, 0]\nbla bla bla im cool man\x00\n"

